import React from 'react'
import {
  View,
  Button,
  TextInput,
  StyleSheet
} from 'react-native'

export default class Index extends React.Component {


    render() {
      return (
          <>
        <View >
          <Button
            title='Login'
            onPress={this.signin}
          />
        </View>
        <View>
          <Button
            title='SIGN UP'
            onPress={this.signin}
          />
          </View>

        </>
      )
    }
  }
